import 'package:flutter/material.dart';
void main() {
  runApp(const MyApp());
}

final List<Map<String, String>> travelData = [
  {'title': 'Raja Ampat', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Bromo', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Danau Toba', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Borobudur', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Bali', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Lombok', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Labuan Bajo', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Taman Mini', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Monas', 'image': 'data:image/jpeg;base64,'},
  {'title': 'Kawah Putih', 'image': 'data:image/jpeg;base64,'},
];

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      title: 'Katalog Wisata',
      home: HomePage(),
      debugShowCheckedModeBanner: false,
    );
  }
}

class HomePage extends StatelessWidget {
  const HomePage({super.key});

  @override
  Widget build(BuildContext context) {
    return DefaultTabController(
      length: 2,
      child: Scaffold(
        appBar: AppBar(
          title: const Text('Katalog Wisata'),
          bottom: const TabBar(
            tabs: [
              Tab(icon: Icon(Icons.list), text: 'List View'),
              Tab(icon: Icon(Icons.grid_on), text: 'Grid View'),
            ],
          ),
        ),
        body: TabBarView(
          children: [
            buildListView(context),
            buildGridView(context),
          ],
        ),
      ),
    );
  }

  Widget buildListView(BuildContext context) {
    return ListView.builder(
      itemCount: travelData.length,
      itemBuilder: (context, index) {
        final item = travelData[index];
        return GestureDetector(
          onTap: () {
            Navigator.push(
              context,
              MaterialPageRoute(
                builder: (_) => DetailPage(
                  title: item['title']!,
                  image: item['image']!,
                ),
              ),
            );
          },
          child: Card(
            margin: const EdgeInsets.symmetric(horizontal: 10, vertical: 5),
            child: ListTile(
              leading: Image.network(item['image']!, width: 100, fit: BoxFit.cover),
              title: Text(item['title']!),
            ),
          ),
        );
      },
    );
  }

  Widget buildGridView(BuildContext context) {
    return GridView.builder(
      padding: const EdgeInsets.all(10),
      itemCount: travelData.length,
      gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(
        crossAxisCount: 2,
        crossAxisSpacing: 10,
        mainAxisSpacing: 10,
      ),
      itemBuilder: (context, index) {
        final item = travelData[index];
        return GestureDetector(
          onTap: () {
            Navigator.push(
              context,
              MaterialPageRoute(
                builder: (_) => DetailPage(
                  title: item['title']!,
                  image: item['image']!,
                ),
              ),
            );
          },
          child: Card(
            elevation: 3,
            child: Column(
              crossAxisAlignment: CrossAxisAlignment.stretch,
              children: [
                Expanded(
                  child: Image.network(
                    item['image']!,
                    fit: BoxFit.cover,
                  ),
                ),
                Padding(
                  padding: const EdgeInsets.all(8.0),
                  child: Text(
                    item['title']!,
                    style: const TextStyle(
                        fontWeight: FontWeight.bold, fontSize: 14),
                    textAlign: TextAlign.center,
                  ),
                ),
              ],
            ),
          ),
        );
      },
    );
  }
}

class DetailPage extends StatelessWidget {
  final String title;
  final String image;

  const DetailPage({
    super.key,
    required this.title,
    required this.image,
  });

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text(title)),
      body: Column(
        crossAxisAlignment: CrossAxisAlignment.stretch,
        children: [
          Image.network(image, height: 250, fit: BoxFit.cover),
          const SizedBox(height: 20),
          Text(
            title,
            textAlign: TextAlign.center,
            style: const TextStyle(
              fontSize: 24,
              fontWeight: FontWeight.bold,
            ),
          ),
        ],
      ),
    );
  }
}
